import{_ as a,c as t,o as s,ag as o}from"./chunks/framework.Ds6Eueu6.js";const u=JSON.parse('{"title":"DROP TABLESPACE","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_TABLESPACE.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_TABLESPACE.md"}'),i={name:"docs/7x/ref_guide/sql_commands/DROP_TABLESPACE.md"};function n(l,e,p,c,d,r){return s(),t("div",null,e[0]||(e[0]=[o(`<h1 id="drop-tablespace" tabindex="-1">DROP TABLESPACE <a class="header-anchor" href="#drop-tablespace" aria-label="Permalink to &quot;DROP TABLESPACE&quot;">​</a></h1><p>Removes a tablespace.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP TABLESPACE [IF EXISTS] &lt;name&gt;</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP TABLESPACE</code> removes a tablespace from the system.</p><p>A tablespace can only be dropped by its owner or a superuser. The tablespace must be empty of all database objects before it can be dropped. It is possible that objects in other databases may still reside in the tablespace even if no objects in the current database are using the tablespace. Also, if the tablespace is listed in the <a href="./../config_params/guc-list.html">temp_tablespaces</a> setting of any active session, <code>DROP TABLESPACE</code> might fail due to temporary files residing in the tablespace.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>IF EXISTS : Do not throw an error if the tablespace does not exist. WarehousePG issues a notice in this case.</p><p>name : The name of the tablespace to remove.</p><h2 id="notes" tabindex="-1"><a id="Notes"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;Notes&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p>You cannot run <code>DROP TABLESPACE</code> inside a transaction block.</p><p>Run <code>DROP TABLESPACE</code> during a period of low activity to avoid issues due to concurrent creation of tables and temporary objects. When a tablespace is dropped, there is a small window in which a table could be created in the tablespace that is currently being dropped. If this occurs, WarehousePG returns a warning. This is an example of the <code>DROP TABLESPACE</code> warning.</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>testdb=# DROP TABLESPACE mytest; </span></span>
<span class="line"><span>WARNING:  tablespace with oid &quot;16415&quot; is not empty  (seg1 192.168.8.145:25433 pid=29023)</span></span>
<span class="line"><span>WARNING:  tablespace with oid &quot;16415&quot; is not empty  (seg0 192.168.8.145:25432 pid=29022)</span></span>
<span class="line"><span>WARNING:  tablespace with oid &quot;16415&quot; is not empty</span></span>
<span class="line"><span>DROP TABLESPACE</span></span></code></pre></div><p>The table data in the tablespace directory is not dropped. You can use the <a href="./ALTER_TABLE.html">ALTER TABLE</a> command to change the tablespace defined for the table and move the data to an existing tablespace.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Remove the tablespace <code>mystuff</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP TABLESPACE mystuff;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>DROP TABLESPACE</code> is a WarehousePG extension.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./CREATE_TABLESPACE.html">CREATE TABLESPACE</a>, <a href="./ALTER_TABLESPACE.html">ALTER TABLESPACE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,23)]))}const b=a(i,[["render",n]]);export{u as __pageData,b as default};
